/*-----Galeria de Sesiones------*/

#Sesiones {
    grid-column: 2/20;
}

.Galeria-Sesiones-1, .Galeria-Sesiones-2 {
    width: 100%;
    height: 50vh;
    margin-top: 2.5rem;
    margin-bottom: 1.5rem;
    display: grid;
    grid-template-columns: 33% 34% 33%;
    grid-template-rows: 33% 34% 33%;
    overflow: hidden;
}

.Galeria-Sesiones-1 .left {
    grid-column: 1/2;
    grid-row: 1/4;
    color: #222;
    display: flex;
    align-items: center;
    justify-content: center;
    background: rgba(255, 255, 255, 0.9);
    transition: 0.3s ease-in-out all;
}

.Galeria-Sesiones-1 .middle {
    grid-column: 2/3;
    grid-row: 1/4;
    transition: 0.3s ease-in-out all;
}

.Galeria-Sesiones-1 .right {
    grid-column: 3/4;
    grid-row: 1/4;
    display: grid;
    grid-template-columns: 50% 50%;
    grid-template-rows: 50% 50%;
    transition: 0.3s ease-in-out all;
    overflow: hidden;
}

.Galeria-Sesiones-1 .left .content, .Galeria-Sesiones-2 .left .content  {
    padding: 2rem 3rem;
}

.Galeria-Sesiones-1 .left .content h2, .Galeria-Sesiones-2 .left .content h2 {
    padding: 1rem 0 .5rem 0;
}

/*-----Galeria Sesiones 2-----*/

.Galeria-Sesiones-2 .left {
    grid-column: 3/4;
    grid-row: 1/4;
    color: #222;
    display: flex;
    align-items: center;
    justify-content: center;
    background: rgba(255, 255, 255, 0.9);
    transition: 0.3s ease-in-out all;
}

.Galeria-Sesiones-2 .middle {
    grid-column: 2/3;
    grid-row: 1/4;
    transition: 0.3s ease-in-out all;
}

.Galeria-Sesiones-2 .right {
    grid-column: 1/2;
    grid-row: 1/4;
    display: grid;
    grid-template-columns: 50% 50%;
    grid-template-rows: 50% 50%;
    transition: 0.3s ease-in-out all;
    overflow: hidden;
}


/*Propiedades de la Galerias Sesiones*/

.Galeria-Sesiones-1 .tile, .Galeria-Sesiones-2 .tile {
    max-height: 25vh;
    padding: 0;
    clear: both;
    float: none;
    overflow: hidden;
}

.Galeria-Sesiones-1 .tile img, .Galeria-Sesiones-2 .tile img {
    height: 100%;
    width: 100%;
    object-fit: cover;
    transition: 0.3s ease-in-out all;
}

.Galeria-Sesiones-1 .tile:hover img, .Galeria-Sesiones-2 .tile:hover img {
    z-index: 2;
    transform: scale(1.30);
}

.Galeria-Sesiones-1 .middle, .Galeria-Sesiones-2 .middle {
    z-index: 2;
    padding: 0;
    overflow: hidden;
}

.Galeria-Sesiones-1 .middle img, .Galeria-Sesiones-2 .middle img {
    width: 100%;
    height: 50vh;
    object-fit: cover;
    transition: 0.35s ease-in-out all;
}

.Galeria-Sesiones-1 .middle:hover img, .Galeria-Sesiones-2 .middle:hover img {
    z-index: 2;
    transform: scale(1.10);
}

.Galeria-Sesiones-1 .middle .img-middle, .Galeria-Sesiones-2 .middle .img-middle {
    position: relative;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
}

.Galeria-Sesiones-1 .middle .MoreBtn, .Galeria-Sesiones-2 .middle .MoreBtn {
    position: absolute;
    left: 0;
    right: 0;
    top: 0;
    bottom: 0;
    display: flex;
    align-items: center;
    justify-content: center;
    z-index: 1;
}

.Galeria-Sesiones-1 .middle .MoreBtn h1, .Galeria-Sesiones-2 .middle .MoreBtn h1 {
    opacity: 0;
    transform: rotate(45deg);
    transition: .8s;
    font-size: 5rem;
    color: #fff;
    padding: 10rem;
}

.Galeria-Sesiones-1 .middle .img-middle:before, .Galeria-Sesiones-2 .middle .img-middle:before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: 1;
    background: linear-gradient(180deg, #262626, #000);
    opacity: 0;
    mix-blend-mode: multiply;
    transition: 0.5s;
}

.Galeria-Sesiones-1 .middle:hover .img-middle:before, .Galeria-Sesiones-2 .middle:hover .img-middle:before {
    opacity: 1;
}

.Galeria-Sesiones-1 .middle:hover h1, .Galeria-Sesiones-2 .middle:hover h1 {
    opacity: 1;
    transform: rotate(0deg);
}

@media(max-width: 1280px){

    .Galeria-Sesiones-1, .Galeria-Sesiones-2{
        display: block;
        height: 100vh;
    }

    .Galeria-Sesiones-1 .middle, .Galeria-Sesiones-2 .middle {
        height: 65vh;
    }

    .Galeria-Sesiones-1 .middle img, .Galeria-Sesiones-2 .middle img {
        height: 100%;
        width: 100%;
        object-fit: cover;
    }

    .Galeria-Sesiones-1 .right, .Galeria-Sesiones-2 .right {
        display: none;
    }

    .Galeria-Sesiones-1 .left, .Galeria-Sesiones-2 .left {
        padding: 2rem 3rem;
        height: 35vh;
    }

    .Galeria-Sesiones-1 .left .content, .Galeria-Sesiones-2 .left .content {
        padding: 0;
    }

    .Galeria-Sesiones-1 .middle .MoreBtn h1, .Galeria-Sesiones-2 .middle .MoreBtn h1 {
        padding: 6rem;
    }
}

